  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:46.693785\",\n\t\"name\": \"bowdoin-national-wildlife-refuge-contaminant-biomonitoring-study-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study was to determine
  the extent of trace element contamination, particularly boron and selenium, and
  organochlorine contamination in sediment and biota at Bowdoin National Wildlife
  Refuge. Specific objectives were to: 1) Determine contaminant loads in adult waterbirds
  (American Avocet (Recurvirostra americana), American Coot, eared Grebe (Podiceps
  nigricollis), dabbling duck species, and diving duck species) upon their arrival
  at the refuge in spring. 2) Determine possible impacts on waterbird production by
  examination of embryos for deformities and analysis of eggs for contaminant levels.
  3) Determine contaminant levels in young-of-the-year waterbirds prior to their fledging
  and departure from Bowdoin. 4) Evaluate potential food chain contamination by determining
  contaminant residues in bottom sediment, aquatic plants and aquatic invertebrates.\",\n\t\"license_title\":
